def def_order_window():
    def order_preview():
        if list_order.selection() == ():
            messagebox.showinfo('Ошибка', 'Выберите заказ',parent=order_window)
            return

        for item in orders:
            if str(item['id']) == str(*list_order.selection()):
                order_preview_current = item
                break

        order_preview_window = Toplevel()
        order_preview_window.title("Заказ №"+str(*list_order.selection()))
        order_preview_window.geometry('500x450')
        x = (order_preview_window.winfo_screenwidth() - order_preview_window.winfo_reqwidth())/2 - 350
        y = (order_preview_window.winfo_screenheight() - order_preview_window.winfo_reqheight())/2 - 140
        order_preview_window_icon = ImageTk.PhotoImage(Image.open(BytesIO(icons['main_icon'])),master=order_preview_window)
        order_preview_window.wm_iconphoto(False, order_preview_window_icon)
        order_preview_window.wm_geometry("+%d+%d" % (x,y))
        order_preview_window.grid_rowconfigure(3, weight=1)
        order_preview_window.grid_columnconfigure(0, weight=1)
        order_preview_window.grid_columnconfigure(1, weight=1)

        order_preview_payment_details = ttk.Frame(order_preview_window,borderwidth=1,relief=SOLID)
        Label(order_preview_payment_details,text='Детали оплаты').grid(column=0,row=0,sticky='W')
        Label(order_preview_payment_details,text=order_preview_current['billing']['first_name']+' '+order_preview_current['billing']['last_name']).grid(column=0,row=1,sticky='W')
        Label(order_preview_payment_details,text=order_preview_current['billing']['address_1']).grid(column=0,row=2,sticky='W')
        Label(order_preview_payment_details,text=order_preview_current['billing']['city']).grid(column=0,row=3,sticky='W')
        Label(order_preview_payment_details,text=order_preview_current['billing']['state']).grid(column=0,row=4,sticky='W')
        Label(order_preview_payment_details,text=order_preview_current['billing']['postcode']).grid(column=0,row=5,sticky='W')
        order_preview_payment_details.grid(column=0,row=0,sticky="NSEW",padx=[5,5],pady=[5,5])

        order_preview_deliver_details = ttk.Frame(order_preview_window,borderwidth=1,relief=SOLID)
        Label(order_preview_deliver_details,text='Детали оплаты').grid(column=0,row=0,sticky='W')
        Label(order_preview_deliver_details,text=order_preview_current['shipping']['first_name']+' '+order_preview_current['billing']['last_name']).grid(column=0,row=1,sticky='W')
        Label(order_preview_deliver_details,text=order_preview_current['shipping']['address_1']).grid(column=0,row=2,sticky='W')
        Label(order_preview_deliver_details,text=order_preview_current['shipping']['city']).grid(column=0,row=3,sticky='W')
        Label(order_preview_deliver_details,text=order_preview_current['shipping']['state']).grid(column=0,row=4,sticky='W')
        Label(order_preview_deliver_details,text=order_preview_current['shipping']['postcode']).grid(column=0,row=5,sticky='W')
        order_preview_deliver_details.grid(column=1,row=0,sticky="NSEW",padx=[5,5],pady=[5,5])

        order_preview_email = ttk.Frame(order_preview_window,borderwidth=1,relief=SOLID)
        Label(order_preview_email,text='Email').grid(column=0,row=0,sticky='W')
        Label(order_preview_email,text=order_preview_current['billing']['email']).grid(column=0,row=1,sticky='W')
        order_preview_email.grid(column=0,row=1,sticky="NSEW",padx=[5,5],pady=[5,5])

        order_preview_shipping_metods = ttk.Frame(order_preview_window,borderwidth=1,relief=SOLID)
        Label(order_preview_shipping_metods,text='Метод доставки').grid(column=0,row=0,sticky='W')
        for item in order_preview_current['shipping_lines']:
            Label(order_preview_shipping_metods,text=item['method_title']).grid(column=0,row=1,sticky='W')
        order_preview_shipping_metods.grid(column=1,row=1,sticky="NSEW",padx=[5,5],pady=[5,5])

        order_preview_payment_over = ttk.Frame(order_preview_window,borderwidth=1,relief=SOLID)
        Label(order_preview_payment_over,text='Платёж через').grid(column=0,row=0,sticky='W')
        Label(order_preview_payment_over,text=order_preview_current['payment_method_title']).grid(column=0,row=1,sticky='W')
        order_preview_payment_over.grid(column=0,row=2,sticky="NSEW",padx=[5,5],pady=[5,5])

        order_preview_products_frame = ttk.Frame(order_preview_window,borderwidth=1,relief=SOLID)
        order_preview_products_frame.grid_columnconfigure(0, weight=1)
        order_preview_products_frame.grid_rowconfigure(0, weight=1)

        order_preview_products = ttk.Treeview(order_preview_products_frame,show="headings",columns=["products","amount","total"])
        order_preview_products.heading("products",text="Товар")
        order_preview_products.column("products",width=275)
        order_preview_products.heading("amount",text="Количество")
        order_preview_products.column("amount",width=100)
        order_preview_products.heading("total",text="Итого")
        order_preview_products.column("total",width=100)
        order_preview_products.grid(column=0,row=0,sticky="NSEW")
        order_preview_products_yscroll = Scrollbar(order_preview_products_frame)
        order_preview_products_yscroll.grid(row=0,column=1,sticky="NS")
        order_preview_products_yscroll.config(command=order_preview_products.yview)
        order_preview_products_xscroll = Scrollbar(order_preview_products_frame)
        order_preview_products_xscroll.grid(row=1,column=0,columnspan=2,sticky="EW")
        order_preview_products_xscroll.config(command=order_preview_products.xview,orient=tk.HORIZONTAL)

        for item in order_preview_current['line_items']:
            order_preview_products.insert('',END,values=[item['name'],item['quantity'],item['total']])

        order_preview_products_frame.grid(column=0,columnspan=2,row=3,sticky="NSEW")

    order_window = Toplevel()
    order_window.title("Заказы")
    order_window.geometry('950x500')
    x = (order_window.winfo_screenwidth() - order_window.winfo_reqwidth())/2 - 350
    y = (order_window.winfo_screenheight() - order_window.winfo_reqheight())/2 - 140
    order_window_icon = ImageTk.PhotoImage(Image.open(BytesIO(icons['main_icon'])),master=order_window)
    order_window.wm_iconphoto(False, order_window_icon)
    order_window.wm_geometry("+%d+%d" % (x,y))
    order_window.grid_rowconfigure(1, weight=1)
    order_window.grid_columnconfigure(0, weight=1)

    order_buttons_frame = ttk.Frame(order_window,borderwidth=1,relief=SOLID)
    Button(order_buttons_frame,text='Предпросмотр',command=order_preview).grid(column=0,row=0)
    order_buttons_frame.grid(column=0,row=0,sticky="NSEW")

    order_list_frame = ttk.Frame(order_window,borderwidth=1,relief=SOLID)
    order_list_frame.grid_rowconfigure(0, weight=1)
    order_list_frame.grid_columnconfigure(0, weight=1)

    list_order = ttk.Treeview(order_list_frame,show="headings",columns=["order","date","status","total","comming"])
    list_order.heading("order",text="Заказ")
    list_order.heading("date",text="Дата")
    list_order.heading("status",text="Статус")
    list_order.heading("total",text="Итого")
    list_order.heading("comming",text="Происхождение")
    list_order.grid(column=0,row=0,sticky="NSEW")
    list_order_yscroll = Scrollbar(order_list_frame)
    list_order_yscroll.grid(row=0,column=1,sticky="NS")
    list_order_yscroll.config(command=list_order.yview)
    list_order_xscroll = Scrollbar(order_list_frame)
    list_order_xscroll.grid(row=1,column=0,columnspan=2,sticky="EW")
    list_order_xscroll.config(command=list_order.xview,orient=tk.HORIZONTAL)

    for item in orders:
        list_order.insert('',END,item['id'],values=[str(item['id']),item['date_created'],item['status'],item['total'],''])

    order_list_frame.grid(column=0,row=1,sticky="NSEW")

    order_status_frame = ttk.Frame(order_window,borderwidth=1,relief=SOLID)
    order_status = Label(order_status_frame,text = 'Готово')
    order_status.grid(column=1,row=0,sticky="NSEW")
    order_status_frame.grid(column=0,row=2,sticky="NSEW")

def def_clients_window():
    def clients_window_fill():
        def clients_window_fill_thread():
            client_window_status['text'] = 'Загрузка списка пользователей'
            i=0
            while True:
                i+=1 
                item = wcapi.get("customers/"+str(i)).json()
                if item.get("id") == None:
                    break
                list_clients.insert("",tk.END,values=(item['username'],item['date_created'],item['email'],item['billing']['country'],item['billing']['city'],item['billing']['state'],item['billing']['postcode'])) 
            client_window_status['text'] = 'Готово'

