def def_MSSQL_connect_window():
    def MSSQL_connect_check():
        def MSSQL_connect_check_thread():
            MSSQL_connect_btn.configure(state='disabled')
            global MSSQL_connect_status
            global sync_time
            global sync_last_time
            settings["MSSQL_conf_server"] = MSSQL_connect_server.get()
            settings["MSSQL_conf_username"] = MSSQL_connect_username.get()
            settings["MSSQL_conf_passwd"] = MSSQL_connect_passwd.get()
            settings["MSSQL_conf_db_name"] = MSSQL_connect_db.get()
            settings["sync_time"] = int(list(sync_intervals.keys())[list(sync_intervals.values()).index(MSSQL_connect_sync.get())])
            try:
                pymssql.connect(server=settings["MSSQL_conf_server"], user=settings["MSSQL_conf_username"], password=settings["MSSQL_conf_passwd"], database=settings["MSSQL_conf_db_name"])
            except:
                MSSQL_connect_btn.configure(state='normal')
                MSSQL_connect_status = False
                sync_time = 0
                mssql_connection_status.config(text="Отсутствует подключение к MSSQL",foreground="red")
                messagebox.showinfo('Ошибка', 'Невозможно подключиться к БД MSSQL!', parent = MSSQL_connect_window)
            else:
                mssql_connection_status.config(text="Подключен к MSSQL",foreground="green")
                MSSQL_connect_status =True
                sync_time = settings['sync_time']
                sync_last_time = datetime.now() - timedelta(seconds=sync_time)

                if (Checkbutton_status.get() == 1):
                    settings["MSSQL_conf_autoconnect"] = "True"
                else:
                    settings["MSSQL_conf_autoconnect"] = "False"
                with open('settings.conf', 'w') as f:
                    f.write(json.dumps(settings))

                MSSQL_connect_btn.configure(state='normal')
                MSSQL_connect_window.destroy()

        MSSQL_connect_thread = threading.Thread(target=MSSQL_connect_check_thread,args=())
        MSSQL_connect_thread.start()

    global settings
    MSSQL_connect_window = Toplevel()
    MSSQL_connect_window.title("Настройка подключения БД MSSQL")
    MSSQL_connect_window.geometry('308x185')
