        MSSQL_connect_passwd.insert(0, settings["MSSQL_conf_passwd"])
        if (settings["MSSQL_conf_autoconnect"]=="True"):
            MSSQL_connect_autoconnect.select()
        if int(settings["sync_time"]) in list(sync_intervals.keys()):
            MSSQL_connect_sync.current(list(sync_intervals.keys()).index(int(settings["sync_time"])))
